import '../index.css';
import { Route, Routes } from "react-router-dom";
import Header from './Header';
import Home from './Home';

function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route exact path="login" element={<Home />} />
      </Routes>
    </div>
  );
}

export default App;
